import "./App.css";
import Header from "./Header.js";
import Footer from "./Footer.js";

const name = "Pravesh Chand";
const time = 2020;

const Box = (props) => {
  return (
    <div className="Maincontent">
      <h1>{props.name}</h1>
      <h2>{props.title}</h2>
      <p>{props.age}</p>
    </div>
  );
};

function App() {
  return (
    <div className="App">
      <Header />

      <main>
        <Box name="Pravesh" title="CEO" age="33" />
        <Box name="Japn" title="DEV" age="83" />
        <Box name="Corona" title="Designer" age="23" />
        <Box name="Corona" title="Designer" age="23" />
        <Box name="Corona" title="Designer" age="23" />
        <Box name="Corona" title="Designer" age="23" />
      </main>

      <Footer />
    </div>
  );
}

export default App;
